import React from 'react';

export default class Genres extends React.Component{
    render(){
        return(
            <div id="categories-4" className="widget widget_categories">
                <h2 className="widget-title"> Genres</h2>
                <ul>
                    <li className="cat-item cat-item-3"><a href="/">CSS</a> </li>

                    <li className="cat-item cat-item-2"><a href="/">Design</a></li>

                    <li className="cat-item cat-item-4"><a href="/">HTML</a></li>

                    <li className="cat-item cat-item-1"><a href="/">Uncategorized</a></li>
                </ul>
            </div>
        );
    }

}
